import React from "react";
import { Navbar } from "./Navbar";
import ImagesCarousel from "./ImagesCarousel";

function Accueil() {
  return (
    <div>
      <Navbar />
      <ImagesCarousel />
      <h2>SACEM INDUSTRIES</h2>

      <p>1966</p>
    </div>
  );
}

export default Accueil;
